import './WVideo.css' 
import promo1 from './promo3.mp4'

const WVideo = () => {
    return (
    <div className="MainVideo">
<video onR
    id="my-video"
    className="video-js vjs-theme-sea"
    autoPlay={true}
    loop={true}
    controls={true}
    preload="auto"
    data-setup="{}"
  >
    <source src={promo1} type="video/mp4"></source>

  </video>
    </div>
    );
}
 
export default WVideo;
